import {default as NextDocument, DocumentContext, Head, Html, Main, NextScript} from 'next/document'
import {Client, Client as Styletron, Server, Sheet} from 'styletron-engine-atomic';
import {Provider as StyletronProvider} from 'styletron-react';
// Force Next-generated DOM elements to fill their parent's height
const normalizeNextElements = `
  #__next {
    display: flex;
    flex-direction: column;
    height: 100%;
  }
`

const engine = new Styletron();

export const STYLETRON_CLASSNAME = '_styletron_hydrate_';

export const isServerStyletron = (props: Client | Server): props is Server =>
    'getStylesheets' in styletron;


export const styletron =
    typeof window === 'undefined'
        ? new Server()
        : new Client({
            hydrate: document.getElementsByClassName(
                STYLETRON_CLASSNAME,
            ) as HTMLCollectionOf<HTMLStyleElement>,
        });

export default class MyDocument extends NextDocument<{
    stylesheets: Sheet[];
}> {
    static override async getInitialProps(context: DocumentContext) {
        const renderPage = () =>
            context.renderPage({
                // eslint-disable-next-line react/display-name
                enhanceApp: App => props =>
                    (
                        <StyletronProvider value={styletron}>
                            <App {...props} />
                        </StyletronProvider>
                    ),
            });

        const initialProps = await NextDocument.getInitialProps({
            ...context,
            renderPage,
        });
        let stylesheets: Sheet[] = [];

        if (isServerStyletron(styletron)) {
            stylesheets = styletron.getStylesheets() || [];
        }

        return {...initialProps, stylesheets};
    }

    render() {
        return (
            <Html style={{height: '100%'}}>
                <Head/>
                <body style={{height: '100%', overflow: 'hidden'}}>
                <Main/>
                <NextScript/>
                </body>
            </Html>
        )
    }
}
